import React from "react";
import './toDoList.css';
import todoItem from './todo-item';

class Lists extends React.Component {
    // constructor(props) {
    //     super(props);
    // }
    render() {
        return (
            <div className="todoList"><todoItem/>
            <todoItem/>
            <todoItem/></div>
        );
    }
}

export default Lists
